import React from 'react'
import { data } from "./App";

const AboutUsChildA = () => {

  return (
    <>
      <data.Consumer>
        {
          (allVal) => {
            return(
              allVal.map((val)=>{
                <li key={val}>{val}</li>
              })
            )
          }
        }
      </data.Consumer>
    </>
  )
}

export default AboutUsChildA



















